import React from 'react'
import { Row, Col } from 'react-bootstrap'
import jobs from '../jobs'

function HomeScreen() {
    return (
        <div>
            <h1> Lastest Jobs </h1>
                {jobs.map(job => (
                    <Row>
                    {job.JobTitle}
                    </Row> 
                ))}
        </div>
    )
}

export default HomeScreen
